import { createImageObject, createRadialGradient, createTextObject, RadialGradient, Text } from "../types/BaseTypes";
import { createPresentation, Presentation } from "../types/Presentation";
import { createSelection, SelectionType } from "../types/Selection";
import { addElement, createBgColor, createBgImage, createSlide, editBackground, SlideType } from "../types/Slide";
import { addSlide } from "../types/SlideCollection";
import { EditorType } from "./editorType";

let presentation: Presentation = createPresentation();
const selection: SelectionType = createSelection();
const radialGradient: RadialGradient = createRadialGradient(["#DFF2CB", "#F0A13A", "#EE609A"], "center");
const text1: Text = createTextObject({ x: 50, y: 100 }, { width: 200, height: 50 }, "Коровий переворачиватель");
text1.fontColor = "white";
text1.fontName = "Lobster";
text1.fontSize = 52;

const image1 = createImageObject(
  { x: 500, y: 200 },
  { width: 500, height: 500 },
  "https://cs12.pikabu.ru/post_img/big/2022/08/14/6/1660468920142970595.png",
  "URL",
);

const image2 = createImageObject(
  { x: 0, y: 0 },
  { width: 100, height: 100 },
  `data:image/png;base64,`,
  "Base64",
);

let slide1: SlideType = createSlide();
slide1.bg = createBgColor(radialGradient);
slide1 = addElement(slide1, text1);
slide1 = addElement(slide1, image1);
slide1 = addElement(slide1, image2);

presentation = addSlide(presentation, slide1);
presentation = addSlide(presentation, createSlide());

let slide2: SlideType = createSlide();
slide2 = editBackground(slide2, createBgImage(image2));
presentation = addSlide(presentation, slide2);

for (let i = 0; i < 5; i++) {
  let tempSlide: SlideType = createSlide();
  let textTemp: Text = createTextObject({ x: 50, y: 100 }, { width: 200, height: 50 }, " " + i);
  textTemp.fontColor = "black";
  textTemp.fontName = "Lobster";
  textTemp.fontSize = 52;

  tempSlide = addElement(tempSlide, textTemp);
  presentation = addSlide(presentation, tempSlide);
}

selection.selectedSlideId = presentation.slideCollection[0].id;

const editor: EditorType = {
  presentation,
  selection: selection,
};

export { editor };
